import React, { Component } from 'react';

class Filters extends Component {

	render() {
		return (
			<div className="Filters">
				<h2>Filtered by:</h2>
				<a href="/">{this.props.link} <span className="badge pull-right">0</span> </a>
				<h2>Gender</h2>
				
			</div>
		);
	}
}
export default Filters;
